        <div>
            <Menu inverted fixed>
                <Container>
                    <Menu.Item
                        name='home'
                    // active={activeItem === 'home'}
                    // onClick={this.handleItemClick}
                    />
                    <Menu.Item
                        name='messages'
                    // active={activeItem === 'messages'}
                    // onClick={this.handleItemClick}
                    />

                    <Menu.Menu position='right'>
                        <AppliedJobs>

                        </AppliedJobs>

                        <Menu.Item>
                            <Button primary>Sign Up</Button>
                        </Menu.Item>
                    </Menu.Menu>
                </Container>

            </Menu>
        </div>
    )
}
